  \"the-streamcat-dataset-accumulated-attributes-for-nhdplusv2-catchments-version-2-1-for-the-conte8de52\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset represents the road density
  within individual, local NHDPlusV2 catchments and upstream, contributing watersheds.
  Attributes of the landscape layer were calculated for every local NHDPlusV2 catchment
  and accumulated to provide watershed-level metrics. (See Supplementary Info for
  Glossary of Terms) This data set is derived from TIGER/Line Files of roads in the
  conterminous United States. Road density describes how many kilometers of road exist
  in a square kilometer. A raster was produced using the ArcGIS Line Density Tool
  to form the landscape layer for analysis. (see Data Sources for links to NHDPlusV2
  data and Census Data) The (kilometer of road/square kilometer) was summarized by
  local catchment and by watershed to produce local catchment-level and watershed-level
  metrics as a continuous data type (see Data Structure and Attribute Information
  for a description).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
